pragma solidity ^0.8.0;

contract CarRental {
    // ==================== ENUMS ====================
    enum BookingStatus {
        Pending,
        Approved,
        Active,
        Completed,
        Cancelled
    }

    enum DisputeStatus {
        Open,
        Resolved,
        Closed
    }

    // ==================== STRUCTS ====================
    struct Car {
        uint256 id;
        address owner;
        string make;
        string model;
        uint256 year;
        uint256 pricePerDay;
        string location;
        bool isAvailable;
        uint256 createdAt;
    }

    struct Booking {
        uint256 id;
        uint256 carId;
        address renter;
        address owner;
        uint256 startDate;
        uint256 endDate;
        uint256 totalPrice;
        BookingStatus status;
        bool pickupConfirmed;
        bool returnConfirmed;
    }

    struct Dispute {
        uint256 id;
        uint256 bookingId;
        address initiator;
        string reason;
        DisputeStatus status;
        uint256 createdAt;
    }

    struct Rating {
        uint256 bookingId;
        address fromOwner;
        address toRenter;
        uint8 score;
        string comment;
        uint256 createdAt;
    }

    struct PhotoProof {
        uint256 bookingId;
        string[] beforePhotos;
        string[] afterPhotos;
        uint256 uploadedAt;
    }

    // ==================== STATE VARIABLES ====================
    mapping(uint256 => Car) public cars;
    mapping(uint256 => Booking) public bookings;
    mapping(uint256 => Dispute) public disputes;
    mapping(address => uint256) public ownerEarnings;
    mapping(uint256 => Rating) public ratings;
    mapping(uint256 => PhotoProof) public photoProofs;
    mapping(address => uint256[]) public ownerCars;
    mapping(uint256 => uint256) public carBookingCount; // Track active bookings per car

    uint256 public carCounter;
    uint256 public bookingCounter;
    uint256 public disputeCounter;

    // ==================== MODIFIERS ====================
    modifier onlyCarOwner(uint256 carId) {
        require(cars[carId].owner == msg.sender, "Only car owner can perform this action");
        _;
    }

    modifier onlyBookingOwner(uint256 bookingId) {
        require(bookings[bookingId].owner == msg.sender, "Only booking owner can perform this action");
        _;
    }

    modifier validBooking(uint256 bookingId) {
        require(bookings[bookingId].id != 0, "Booking does not exist");
        _;
    }

    modifier validCar(uint256 carId) {
        require(cars[carId].id != 0, "Car does not exist");
        _;
    }

    // ==================== EVENTS ====================
    event CarListed(uint256 indexed carId, address indexed owner, string make, string model);
    event ListingEdited(uint256 indexed carId, address indexed owner);
    event BookingApproved(uint256 indexed bookingId, address indexed owner, address indexed renter);
    event PickupConfirmed(uint256 indexed bookingId, address indexed owner);
    event ReturnConfirmed(uint256 indexed bookingId, address indexed owner, uint256 amount);
    event ProofUploaded(uint256 indexed bookingId, address indexed owner);
    event DisputeOpened(uint256 indexed disputeId, uint256 indexed bookingId, address indexed initiator);
    event EarningsWithdrawn(address indexed owner, uint256 amount);
    event RenterRated(uint256 indexed bookingId, address indexed renter, uint8 score);

    // ==================== OWNER FUNCTIONS ====================

    /**
     * @dev List a car for rent
     * @param make Car manufacturer
     * @param model Car model
     * @param year Car year
     * @param pricePerDay Price per day in wei
     * @param location Car location
     * @return carId The ID of the newly listed car
     */
    function listCarForRent(
        string memory make,
        string memory model,
        uint256 year,
        uint256 pricePerDay,
        string memory location
    ) public returns (uint256) {
        require(bytes(make).length > 0, "Make cannot be empty");
        require(bytes(model).length > 0, "Model cannot be empty");
        require(year > 1900 && year <= block.timestamp, "Invalid year");
        require(pricePerDay > 0, "Price must be greater than 0");

        carCounter++;
        uint256 carId = carCounter;

        cars[carId] = Car({
            id: carId,
            owner: msg.sender,
            make: make,
            model: model,
            year: year,
            pricePerDay: pricePerDay,
            location: location,
            isAvailable: true,
            createdAt: block.timestamp
        });

        ownerCars[msg.sender].push(carId);

        emit CarListed(carId, msg.sender, make, model);
        return carId;
    }

    /**
     * @dev Edit an existing car listing
     * @param carId The ID of the car to edit
     * @param newMake New car manufacturer
     * @param newModel New car model
     * @param newYear New car year
     * @param newPricePerDay New price per day in wei
     * @param newLocation New car location
     */
    function editListing(
        uint256 carId,
        string memory newMake,
        string memory newModel,
        uint256 newYear,
        uint256 newPricePerDay,
        string memory newLocation
    ) public onlyCarOwner(carId) validCar(carId) {
        require(carBookingCount[carId] == 0, "Cannot edit car with active bookings");
        require(bytes(newMake).length > 0, "Make cannot be empty");
        require(bytes(newModel).length > 0, "Model cannot be empty");
        require(newYear > 1900 && newYear <= block.timestamp, "Invalid year");
        require(newPricePerDay > 0, "Price must be greater than 0");

        cars[carId].make = newMake;
        cars[carId].model = newModel;
        cars[carId].year = newYear;
        cars[carId].pricePerDay = newPricePerDay;
        cars[carId].location = newLocation;

        emit ListingEdited(carId, msg.sender);
    }

    /**
     * @dev Approve a booking request
     * @param bookingId The ID of the booking to approve
     */
    function approveBooking(uint256 bookingId)
        public
        onlyBookingOwner(bookingId)
        validBooking(bookingId)
    {
        Booking storage booking = bookings[bookingId];
        require(booking.status == BookingStatus.Pending, "Booking is not pending");
        require(cars[booking.carId].isAvailable, "Car is not available");

        booking.status = BookingStatus.Approved;
        cars[booking.carId].isAvailable = false;
        carBookingCount[booking.carId]++;

        emit BookingApproved(bookingId, msg.sender, booking.renter);
    }

    /**
     * @dev Confirm car pickup
     * @param bookingId The ID of the booking
     */
    function confirmPickup(uint256 bookingId)
        public
        onlyBookingOwner(bookingId)
        validBooking(bookingId)
    {
        Booking storage booking = bookings[bookingId];
        require(booking.status == BookingStatus.Approved, "Booking must be approved first");
        require(block.timestamp >= booking.startDate, "Pickup date has not arrived");

        booking.pickupConfirmed = true;
        booking.status = BookingStatus.Active;

        emit PickupConfirmed(bookingId, msg.sender);
    }

    /**
     * @dev Confirm car return
     * @param bookingId The ID of the booking
     */
    function confirmReturn(uint256 bookingId)
        public
        onlyBookingOwner(bookingId)
        validBooking(bookingId)
    {
        Booking storage booking = bookings[bookingId];
        require(booking.status == BookingStatus.Active, "Booking must be active");
        require(booking.pickupConfirmed, "Pickup must be confirmed first");
        require(block.timestamp >= booking.endDate, "Return date has not arrived");

        booking.returnConfirmed = true;
        booking.status = BookingStatus.Completed;
        cars[booking.carId].isAvailable = true;
        carBookingCount[booking.carId]--;

        // Release payment to owner
        ownerEarnings[msg.sender] += booking.totalPrice;

        emit ReturnConfirmed(bookingId, msg.sender, booking.totalPrice);
    }

    /**
     * @dev Upload proof photos (before and after)
     * @param bookingId The ID of the booking
     * @param beforePhotos Array of photo URLs/hashes for before state
     * @param afterPhotos Array of photo URLs/hashes for after state
     */
    function uploadProof(
        uint256 bookingId,
        string[] memory beforePhotos,
        string[] memory afterPhotos
    ) public onlyBookingOwner(bookingId) validBooking(bookingId) {
        require(beforePhotos.length > 0 || afterPhotos.length > 0, "Must upload at least one photo");

        photoProofs[bookingId] = PhotoProof({
            bookingId: bookingId,
            beforePhotos: beforePhotos,
            afterPhotos: afterPhotos,
            uploadedAt: block.timestamp
        });

        emit ProofUploaded(bookingId, msg.sender);
    }

    /**
     * @dev Open a dispute for a booking
     * @param bookingId The ID of the booking
     * @param reason Reason for the dispute
     * @return disputeId The ID of the newly created dispute
     */
    function openDispute(uint256 bookingId, string memory reason)
        public
        onlyBookingOwner(bookingId)
        validBooking(bookingId)
        returns (uint256)
    {
        require(bytes(reason).length > 0, "Reason cannot be empty");
        require(
            bookings[bookingId].status == BookingStatus.Active ||
                bookings[bookingId].status == BookingStatus.Approved,
            "Can only dispute active or approved bookings"
        );

        disputeCounter++;
        uint256 disputeId = disputeCounter;

        disputes[disputeId] = Dispute({
            id: disputeId,
            bookingId: bookingId,
            initiator: msg.sender,
            reason: reason,
            status: DisputeStatus.Open,
            createdAt: block.timestamp
        });

        emit DisputeOpened(disputeId, bookingId, msg.sender);
        return disputeId;
    }

    /**
     * @dev Withdraw accumulated earnings
     */
    function withdrawEarnings() public {
        uint256 earnings = ownerEarnings[msg.sender];
        require(earnings > 0, "No earnings to withdraw");

        ownerEarnings[msg.sender] = 0;

        (bool success, ) = payable(msg.sender).call{value: earnings}("");
        require(success, "Transfer failed");

        emit EarningsWithdrawn(msg.sender, earnings);
    }

    /**
     * @dev Rate a renter after booking completion
     * @param bookingId The ID of the completed booking
     * @param score Rating score (1-5)
     * @param comment Optional comment
     */
    function rateRenter(
        uint256 bookingId,
        uint8 score,
        string memory comment
    ) public onlyBookingOwner(bookingId) validBooking(bookingId) {
        require(bookings[bookingId].status == BookingStatus.Completed, "Booking must be completed");
        require(score >= 1 && score <= 5, "Score must be between 1 and 5");
        require(ratings[bookingId].createdAt == 0, "Renter already rated for this booking");

        ratings[bookingId] = Rating({
            bookingId: bookingId,
            fromOwner: msg.sender,
            toRenter: bookings[bookingId].renter,
            score: score,
            comment: comment,
            createdAt: block.timestamp
        });

        emit RenterRated(bookingId, bookings[bookingId].renter, score);
    }

    // ==================== VIEW FUNCTIONS ====================

    /**
     * @dev Get car details
     * @param carId The ID of the car
     * @return Car struct
     */
    function getCar(uint256 carId) public view validCar(carId) returns (Car memory) {
        return cars[carId];
    }

    /**
     * @dev Get booking details
     * @param bookingId The ID of the booking
     * @return Booking struct
     */
    function getBooking(uint256 bookingId)
        public
        view
        validBooking(bookingId)
        returns (Booking memory)
    {
        return bookings[bookingId];
    }

    /**
     * @dev Get all car IDs owned by an address
     * @param owner The owner's address
     * @return Array of car IDs
     */
    function getOwnerCars(address owner) public view returns (uint256[] memory) {
        return ownerCars[owner];
    }

    /**
     * @dev Get owner's pending earnings
     * @param owner The owner's address
     * @return Pending earnings in wei
     */
    function getOwnerEarnings(address owner) public view returns (uint256) {
        return ownerEarnings[owner];
    }

    /**
     * @dev Get dispute details
     * @param disputeId The ID of the dispute
     * @return Dispute struct
     */
    function getDispute(uint256 disputeId) public view returns (Dispute memory) {
        require(disputes[disputeId].id != 0, "Dispute does not exist");
        return disputes[disputeId];
    }

    /**
     * @dev Get photo proof for a booking
     * @param bookingId The ID of the booking
     * @return PhotoProof struct
     */
    function getPhotoProof(uint256 bookingId) public view returns (PhotoProof memory) {
        require(photoProofs[bookingId].uploadedAt != 0, "Photo proof does not exist");
        return photoProofs[bookingId];
    }

    /**
     * @dev Get rating for a booking
     * @param bookingId The ID of the booking
     * @return Rating struct
     */
    function getRating(uint256 bookingId) public view returns (Rating memory) {
        require(ratings[bookingId].createdAt != 0, "Rating does not exist");
        return ratings[bookingId];
    }

    // ==================== RECEIVE FUNCTION ====================
    // Allow contract to receive payments (for booking payments)
    receive() external payable {}
}

